<style type="text/css">
#mynetwork {
	width: 100%;
	height: 95%;
	border: 1px solid lightgray;
}
</style>

<body>
	<input type="range" id="minvalue" min="1" max="30" value="15"
		onChange="redraw();">
	<div id="mynetwork"></div>

		var jsonResp;

		function filtervalue(edge) {
			return edge.value >= document.getElementById('minvalue').value;
		}

		function getData() {

			var nodes = [];
			var edges = [];

			if (jsonResp) {
				nodes = jsonResp.nodes;
				edges = jsonResp.edges.filter(filtervalue);
			}

			return {
				nodes : new vis.DataSet(nodes),
				edges : new vis.DataSet(edges)
			};
		}
